import '../styles/header.css';

const Header = () => {
    return (
        <div className='header'>
            <div className='left_section_header'>
                <h2>Обосанное приложение</h2>
            </div>

            <div className='right_section_header'>
                <h2>Я</h2>
            </div>
        </div>
    )
}

export default Header;
